import Blog from './components/Blog'
import blogService from './services/blogs'

const App = () => {
  const [blogs, setBlogs] = useState([])

  useEffect(() => {
    blogService.getAll().then(blogs =>
      setBlogs( blogs )
    )
  }, [])

  const handleLogin = () => {
    console.log('hoera!')
  }

  const loginForm = () => {
    <div>
    <h1>log in to application</h1>
    <form onSubmit={handleLogin}>
      <input name="Username"/>
      <input name="Password"/>
    </form>
    </div>
  }

  return (
    <div>
    {loginForm()}
    </div>
  )
}

export default App
